INSERT INTO `v1_39d11c9aa71271694797774bb412826b7f275a705e172a3824d54ce19305360e` VALUES (1, 0.625, 6, "ツムギのサマーボトルキャップ", 0.75, 11602, "サマー衣装のツムギが、キャップでオンステージ！涼しげな衣装を\nまとい、熱いステージを繰り広げた彼女の勇姿を思い出すことがで\nきる。");
